import React, { useRef, useState } from 'react';
import emailjs from 'emailjs-com';
import './App.css';
import './index.css';
import logo from './logo.png';

function App() {
  const form = useRef();
  const [submitted, setSubmitted] = useState(false);

  const sendEmail = (e) => {
    e.preventDefault();

    // ðŸ§© Enter your EmailJS credentials here
    emailjs.sendForm(
      'your_service_id',      // ðŸ”‘ Replace with YOUR Service ID
      'your_template_id',     // ðŸ”‘ Replace with YOUR Template ID
      form.current,
      'your_user_id'          // ðŸ”‘ Replace with YOUR Public Key (User ID)
    ).then(() => {
      setSubmitted(true);
    }).catch((error) => {
      console.error("Email error:", error);
    });
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 to-teal-100 font-sans">
      {/* Header */}
      <header className="flex justify-between items-center px-6 py-4 shadow-md bg-white">
        <div>
          <h1 className="text-2xl font-bold text-teal-700">Ghar Ki Baat</h1>
          <p className="text-sm text-gray-600">When no one listens, we do.</p>
        </div>
        <img src={logo} alt="Logo" className="w-16 h-16" />
      </header>

      {/* Hero Section */}
      <section className="text-center px-4 py-10">
        <h2 className="text-3xl font-semibold text-gray-800 mb-4">Private Mental Health Sessions</h2>
        <p className="text-lg text-gray-600">Confidential â€¢ Caring â€¢ Affordable</p>
      </section>

      {/* Pricing Info */}
      <section className="bg-white py-4 mb-6">
        <h3 className="text-center text-xl text-gray-800 font-semibold">Session Pricing</h3>
        <p className="text-center text-gray-600 mt-2">â‚¹99 â€¢ â‚¹199 â€¢ â‚¹200 depending on your needs</p>
      </section>

      {/* Booking Form */}
      <section className="max-w-xl mx-auto p-6 bg-white shadow rounded-xl">
        <h3 className="text-xl font-semibold mb-4 text-teal-700">Book a Session</h3>
        <form ref={form} onSubmit={sendEmail} className="space-y-4">
          <div>
            <label className="block text-sm font-medium text-gray-700">Your Name</label>
            <input type="text" name="user_name" required className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-teal-500 focus:border-teal-500" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Email</label>
            <input type="email" name="user_email" required className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-teal-500 focus:border-teal-500" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Message</label>
            <textarea name="message" rows="4" required className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-teal-500 focus:border-teal-500"></textarea>
          </div>
          <div>
            <label className="block text-sm font-bold text-gray-700">Upload Payment Success Image</label>
            <input type="file" name="payment_proof" accept="image/*" className="mt-1 block w-full" />
          </div>
          <button type="submit" className="bg-teal-600 text-white px-6 py-2 rounded-lg hover:bg-teal-700 transition">Submit</button>
        </form>
        {submitted && <p className="text-green-600 mt-4">Thank you! Weâ€™ve received your request.</p>}
      </section>

      {/* Footer */}
      <footer className="text-center text-sm text-gray-500 mt-8 mb-4">
        &copy; {new Date().getFullYear()} Ghar Ki Baat. All rights reserved.
      </footer>
    </div>
  );
}

export default App;
